import React from 'react';
import ReactApexChart from 'react-apexcharts';

const generateData = (count: number, options: { min: number; max: number }) => {
  const data = [];
  for (let i = 0; i < count; i++) {
    data.push(Math.floor(Math.random() * (options.max - options.min + 1)) + options.min);
  }
  return data;
};


const ClientResourceChart: React.FC = () => {
  const [state, setState] = React.useState({
    series: [
      {
        name: 'Jan',
        data: generateData(20, { min: -30, max: 55 }),
      },
      {
        name: 'Jan',
        data: generateData(20, { min: -30, max: 55 }),
      },
    ],
    options: {
      chart: {
        height: 350,
        type: "heatmap" as const,
      },
      plotOptions: {
        heatmap: {
          shadeIntensity: 0.5,
          radius: 0,
          useFillColorAsStroke: true,
          colorScale: {
            ranges: [
              { from: -30, to: 5, name: 'low', color: '#00A100' },
              { from: 6, to: 20, name: 'medium', color: '#128FD9' },
              { from: 21, to: 45, name: 'high', color: '#FFB200' },
              { from: 46, to: 55, name: 'extreme', color: '#FF0000' },
            ],
          },
        },
      },
      dataLabels: {
        enabled: false,
      },
      stroke: {
        width: 1,
      },
      title: {
        text: 'HeatMap Chart with Color Range',
      },
    },
  });

  return <ReactApexChart options={state.options} series={state.series} type="heatmap" height={350} />;
};

export default ClientResourceChart;
